import styles from './styles.module.css'
import { Col } from 'react-bootstrap'
import title from '../../../../assets/favicon.png'
export function Title() {
  return (
    <Col md={12}>
      <img
        style={{
          position: 'relative',
          display: 'flex',
          flexDirection: 'row',
          justifyContent: 'center',
          alignItems: 'center',
          height: '350px',
          width: '400px',
          left: '40%',
          marginTop: '50%',
        }}
        src={title}
        alt=""
      />
    </Col>
  )
}
